import React, { useEffect, useState } from 'react'
import DataTable from '../common/DataTable/DataTable';

const columns = [
    { field: 'title', headerName: 'title', width: 150 },
    { field: 'year', headerName: 'year', width: 150 },
    { field: 'director', headerName: 'director', width: 150 },
    { field: 'actors', headerName: 'actors', width: 200 },
    { field: 'rating', headerName: 'rating', width: 200 },
];

const userTableStyles = {
    height: '650px',
};

const UserTable = ({ onError }) => {
    const [movies, setUsers] = useState([]);

    useEffect(() => {

        const apiUrl = 'https://4a2efnh5o5.execute-api.us-east-1.amazonaws.com/default/getMovieApi';

        fetch(apiUrl, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            // Add any other necessary headers here
          },
        })
            .then((response) => response.json())
            .then((json) => setUsers(json))
            .catch(() => onError())
    }, []);

    return (
        <DataTable
            rows={movies}
            columns={columns}
            loading={!movies.length}
            sx={userTableStyles}
        />
    );
};

export default UserTable
